  false,\n\t\"url\": null,\n\t\"notes\": \"This draft Comprehensive Conservation Plan
  (CCP) was written to guide management on the Upper Souris National Wildlife Refuge
  Complex for the next 15 years. This plan outlines the Complex vision and purpose
  and describes how the Complex will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the Complex and the individual refuges
  that make up the Complex, an overview of the CCP planning process, a summary of
  Complex resources, goals and objectives, alternatives, information about the management
  direction, a description of the affected environment, and environmental consequences.\",\n\t\"license_title\":
